import styled from "styled-components";

export const Container = styled.div`
    background: #FFFFFF;
`;

export const HeaderButtonLeft = styled.button`
    top: 18px;
    margin-left: 10px;
    left: 10px;
    position: absolute;
    border-radius: 10px;
    border: none;
`;

export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    position: absolute;
    border-radius: 10px;
    top: 18px;
    border: none;
`;

export const Title = styled.h1`
    position: absolute;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    top: 16px;
    left: 140px;
`;

export const Container1 = styled.div`
position: absolute;
width: 315px;
height: 48px;
left: 30px;
top: 102px;
background: #F7F8F8;
border-radius: 16px;
`;

export const Text1 = styled.text`
    position: absolute;
    width: 85px;
    height: 18px;
    left: 73px;
    top: 117px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #7B6F72;
`;

export const Text2 = styled.text`
    position: absolute;
    width: 22px;
    height: 15px;
    left: 285px;
    top: 119px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 400;
    font-size: 10px;
    line-height: 15px;
    text-align: right;
    color: #ADA4A5;
`;

export const Container2 = styled.div`
    position: absolute;
    width: 315px;
    height: 48px;
    left: 30px;
    top: 160px;
    background: #F7F8F8;
    border-radius: 16px;
`;

export const Text3 = styled.text`
    position: absolute;
    width: 88px;
    height: 18px;
    left: 73px;
    top: 175px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #7B6F72;
`;

export const Text4 = styled.text`
    position: absolute;
    width: 65px;
    height: 15px;
    left: 242px;
    top: 177px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 400;
    font-size: 10px;
    line-height: 15px;
    text-align: right;
    color: #ADA4A5;
`;

export const Button1 = styled.button`
    justify-content: space-between;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    border-radius:99px;
    position: absolute;
    top:585px;
    width: 315px;
    height: 60px;
    left:31px;
    display: flex;
    flex-direction: row;
    align-items: flex-start;
    padding: 18px 129px;
    box-shadow: 0px 10px 22px rgba(149, 173, 254, 0.3);
    border: none;
`;

export const Title1 = styled.text`
    position: absolute;
    width: 34px;
    height: 24px;
    left: 118.5px;
    top: 20px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 700;
    font-size: 16px;
    line-height: 24px;
    color: #FFFFFF;
    flex: none;
    order: 0;
    flex-grow: 0;
    margin: 0px 10px;
    justify-content: center;
`;
